theme.css:
:root {
  --button-background: rgb(164, 183, 113);
  --btn-view-effect: rgba(100, 57, 7, 0.5);
  --btn-delete-effect: rgba(205, 50, 50, 0.5);
  --chain-month-label: rgb(211, 198, 18);
  --chain-month-label-bg: rgb(152, 79, 11);
  --app-card-bd: rgba(142, 140, 87, 0.644);
  --app-card-bg: rgba(100, 78, 38, 0.575);
  --chain-border-color: rgb(58, 43, 3);
  --btn-color-settings-effect: rgba(107, 0, 104, 0.5);
  --btn-reset-effect: rgba(169, 186, 13, 0.5);
  --btn-add-chain-effect: rgba(232, 117, 23, 0.5);
  --btn-load-file-effect: rgba(24, 46, 78, 0.5);
  --outer-layer-bg: rgb(0, 0, 0);
  --outer-scroll-track: rgb(219, 159, 57);
  --outer-scroll-thumb: rgb(56, 44, 11);
  --app-card-thumb: rgba(95, 45, 5, 0.8);
}

.x-mark {
  stroke: rgba(38, 34, 34, 0.85);
}

.chain-title {
  color: rgb(193, 103, 1);
}

.chain-tab {
  color: rgb(186, 198, 93);
}

input {
  background-color: rgb(195, 206, 115);
}

.ring-number-box {
  background-color: rgba(49, 66, 0, 0.34);
  border-color: rgba(75, 73, 1, 0.62);
}

#show-count {
  color: rgb(199, 103, 51);
}

.parenthesis {
  color: rgb(187, 162, 93);
}

.form-titles {
  color: rgb(189, 90, 10);
}

#btn-add-chain {
  color: rgb(149, 65, 9);
  border-color: rgb(162, 89, 22);
}

.selections label {
  color: rgb(13, 12, 12);
  border-color: rgb(27, 28, 23);
}

.size-box > * {
  border-color: rgb(6, 55, 47);
}

.helper-info {
  color: rgb(182, 191, 59);
}

#btn-delete {
  color: rgb(137, 16, 16);
  border-color: rgb(130, 13, 13);
}

.chain td.month-break-left {
  border-left-color: rgb(38, 104, 8);
}

.chain td.year-break-left {
  border-left-color: rgb(111, 18, 11);
}

.chain td.empty-cell {
  background-color: rgb(29, 15, 2);
}

.chain tr:first-child > th:not(:first-child) {
  color: rgb(225, 246, 121);
  background-color: rgb(16, 60, 33);
}

.chain tr:first-child > th:first-child {
  color: rgb(147, 55, 6);
}

.chain-info {
  color: rgb(142, 116, 21);
}

.main-title {
  color: rgb(171, 82, 23);
}

.radio-type label:has(input:checked) {
  color: rgb(170, 166, 60);
  background-color: rgba(0, 0, 0, 0.5);
}

#weekdays label:has(input:checked) {
  color: rgb(201, 202, 109);
  background-color: rgba(0, 0, 0, 0.5);
}

.chain td, .circle-cell {
  color: rgb(74, 79, 8);
  background-color: rgb(221, 208, 120);
}

.text-total-ring {
  color: rgb(43, 143, 15);
}

#btn-load-file {
  color: rgb(22, 37, 59);
  border-color: rgb(71, 96, 133);
}

#btn-backup-download {
  color: rgb(38, 95, 27);
  border-color: rgb(81, 133, 46);
}

#btn-reset {
  color: rgb(141, 136, 7);
  border-color: rgb(180, 174, 4);
}

#btn-toggle-menu {
  color: rgb(119, 3, 3);
  border-color: rgb(87, 0, 0);
}

#btn-color-settings {
  border-color: rgb(70, 1, 70);
}

#btn-view {
  color: rgb(44, 26, 2);
  border-color: rgb(25, 10, 1);
}

.main-frame {
  background-color: rgba(88, 133, 99, 0.733);
  border-color: rgba(34, 80, 50, 0.62);
}

hr {
  border-color: rgb(143, 77, 15);
}

input:focus, input:focus-visible {
  outline-style: none;
  box-shadow: rgba(236, 211, 67, 0.7) 0px 0px 0px 3px;
}

::-webkit-inner-spin-button {
  filter: invert(1);
}

.about-me {
  color: rgba(231, 201, 65, 0.4);
}
